import "./App.css";
import creatSocketConnection from "./connect";

function App() {
  let payload = 0;
  payload = creatSocketConnection("ticker");
  console.log(payload);
  return (
    <div className="App">
      <header className="App-header">
        <p>{payload}</p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
